import React, { Component } from 'react';
import './App.css';

class About extends Component{

render(){
    return(
        <div className="main">
            About:
            name is tom,
            portfolio,
            what I do...
            experience,
            interests, etc
            CV?
        </div>
    )
}

}

export default About;
